import optuna

# 目的関数を定義
def objective(trial):
    x = trial.suggest_float("x", -10, 10)
    return (x - 2) ** 2

# Studyの作成
study = optuna.create_study()
# 最適化の開始
study.optimize(objective, n_trials=100)

# 結果を出力
best_params = study.best_params
found_x = best_params["x"]
print("Found x: {}, (x - 2)^2: {}".format(found_x, (found_x - 2) ** 2))
# この方法でもいい
print("Found x: {}, (x - 2)^2: {}".format(study.best_params, study.best_value))

# 最良のトライアルを得る(最良のトライアルのFrozenTrialオブジェクトという詳細な結果が出力される。)
study.best_trial

# すべてのトライアルを得る
study.trials
# 1,2番目のトライアルを得る
for trial in study.trials[:2]:
    print(trial)

# トライアルの数を得る
len(study.trials)

# 再度omptimazeを実行することによって、最適化を継続できる
study.optimize(objective, n_trials=100)

# trialの数は200となる
len(study.trials)

# 今回の目的関数は非常に簡単なため、結果は改善されないが、より複雑なものだと改善が見込める
best_params = study.best_params
found_x = best_params["x"]
print("Found x: {}, (x - 2)^2: {}".format(found_x, (found_x - 2) ** 2))


